import React,{Component}  from 'react';
import axios from 'axios';
import {toast} from 'react-toastify'; 
import 'react-toastify/dist/ReactToastify.css';
import {APIData} from './APIData';
toast.configure()

const sessiondetails = JSON.parse(localStorage.getItem("sessiondetails"));
class ChangePassword extends Component {
    state = {
        username: sessiondetails.user,
        password: null
      }
      changeHandler = e => {
        this.setState({ [e.target.name]: e.target.value })
      }

      submitHandler = e => {
        e.preventDefault()
        console.log(this.state)
        axios
          .post(APIData.api+'login-type/update', this.state,{headers:APIData.headers})
          .then(response => {
              if(response.status==200){
                toast("Password Changed")
                //change URL LATER
                const url = new URL(APIData.url);
                window.location.href = url;
                localStorage.clear();
              }
              else
              {
                toast("Password Update Failed")
              }
            
                
            
        })
          .catch(error => {
            toast("Its time to grab coffee")
            console.log(error)
          })
      }
    render() { 
        const {password} = this.state
        return (  
            
            <div className="changePassword">
                <form className="signin">
        <div className="carrybox">
            <div className="card-header">
            <h3 className="heading01">Change Password</h3>
            <div  className="bringitcenter">
            <img className="profile_img" src="data:image/png;base64," alt />
            </div >
            <div 
            className="bringitcenter">
                <p className="ptag">ID :
                <strong className="ptag">{sessiondetails.user}
                </strong>
                </p>
                </div>
            </div>         
      <div className="row">
      <div className="col-25">
      <label 
      className="heading02" 
      htmlFor="Confirmpassword">Enter New Password :</label>
      
      <div className="col-25">
      <input 
      className="inputfield" 
      type="password" 
      id="Confirmpassword" 
      name="password" 
      value={password}
      onChange={this.changeHandler} 
      placeholder="Confirm Password" />
      </div>
      </div>
      </div>
      
            </div>  
            <div className="row">
            <button className="Submitbutton" type="submit" onClick = {this.submitHandler}>Update</button>
      </div>
      </form>
            </div>
        );
    }
}
 
export default ChangePassword;
